import React from 'react';
import { useTranslation } from 'react-i18next';
import { Prism as SyntaxHighlighter } from 'react-syntax-highlighter';
import { tomorrow } from 'react-syntax-highlighter/dist/esm/styles/prism';
import LanguageSwitcher from './components/LanguageSwitcher';
import './i18n';

const App: React.FC = () => {
  const { t } = useTranslation();

  const gradleCode = `dependencies {
    implementation 'io.github.turtle-watch:turtle-watch:1.0.0'
}`;

  const ymlCode = `turtle-watch:
  enabled: true
  threshold-ms: 500  # 500ms 이상 걸리는 쿼리를 슬로우 쿼리로 감지
  log-level: WARN
  show-stack-trace: true
  analyze-execution-plan: true`;

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Header */}
      <header className="bg-white shadow">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-4 flex justify-between items-center">
          <h1 className="text-2xl font-bold text-gray-900">Turtle Watch</h1>
          <LanguageSwitcher />
        </div>
      </header>

      {/* Main Content */}
      <main className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
        {/* Getting Started */}
        <section className="mb-12">
          <h2 className="text-3xl font-bold text-gray-900 mb-6">{t('gettingStarted.title')}</h2>
          <p className="text-lg text-gray-600 mb-8">{t('gettingStarted.description')}</p>

          {/* Installation */}
          <div className="mb-8">
            <h3 className="text-2xl font-semibold text-gray-900 mb-4">{t('gettingStarted.installation.title')}</h3>
            <div className="bg-white rounded-lg shadow-sm p-6">
              <h4 className="text-lg font-medium text-gray-900 mb-2">{t('gettingStarted.installation.gradle.title')}</h4>
              <p className="text-gray-600 mb-4">{t('gettingStarted.installation.gradle.description')}</p>
              <SyntaxHighlighter language="groovy" style={tomorrow}>
                {gradleCode}
              </SyntaxHighlighter>
            </div>
          </div>

          {/* Configuration */}
          <div>
            <h3 className="text-2xl font-semibold text-gray-900 mb-4">{t('gettingStarted.configuration.title')}</h3>
            <div className="bg-white rounded-lg shadow-sm p-6">
              <p className="text-gray-600 mb-4">{t('gettingStarted.configuration.description')}</p>
              <SyntaxHighlighter language="yaml" style={tomorrow}>
                {ymlCode}
              </SyntaxHighlighter>
              <div className="mt-6 grid grid-cols-1 gap-4 sm:grid-cols-2">
                {Object.entries(t('gettingStarted.configuration.properties', { returnObjects: true })).map(([key, value]: [string, any]) => (
                  <div key={key} className="bg-gray-50 rounded-lg p-4">
                    <h4 className="font-medium text-gray-900">{value.title}</h4>
                    <p className="text-sm text-gray-600">{value.description}</p>
                  </div>
                ))}
              </div>
            </div>
          </div>
        </section>

        {/* Features */}
        <section className="mb-12">
          <h2 className="text-3xl font-bold text-gray-900 mb-6">{t('features.title')}</h2>
          <div className="grid grid-cols-1 gap-6 sm:grid-cols-2 lg:grid-cols-4">
            {Object.entries(t('features', { returnObjects: true }))
              .filter(([key]) => key !== 'title')
              .map(([key, value]: [string, any]) => (
                <div key={key} className="bg-white rounded-lg shadow-sm p-6">
                  <h3 className="text-lg font-medium text-gray-900 mb-2">{value.title}</h3>
                  <p className="text-gray-600">{value.description}</p>
                </div>
              ))}
          </div>
        </section>

        {/* Analysis Rules */}
        <section>
          <h2 className="text-3xl font-bold text-gray-900 mb-6">{t('analysisRules.title')}</h2>
          <div className="space-y-6">
            {Object.entries(t('analysisRules', { returnObjects: true }))
              .filter(([key]) => key !== 'title')
              .map(([key, value]: [string, any]) => (
                <div key={key} className="bg-white rounded-lg shadow-sm p-6">
                  <h3 className="text-xl font-semibold text-gray-900 mb-2">{value.title}</h3>
                  <p className="text-gray-600 mb-4">{value.description}</p>
                  <div className="bg-gray-50 rounded-lg p-4">
                    <h4 className="font-medium text-gray-900 mb-2">해결 방안:</h4>
                    <ul className="list-disc list-inside space-y-1">
                      {value.solutions.map((solution: string, index: number) => (
                        <li key={index} className="text-gray-600">{solution}</li>
                      ))}
                    </ul>
                  </div>
                </div>
              ))}
          </div>
        </section>
      </main>

      {/* Footer */}
      <footer className="bg-white border-t border-gray-200 mt-12">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-6">
          <p className="text-center text-gray-500 text-sm">
            © 2024 Turtle Watch. All rights reserved.
          </p>
        </div>
      </footer>
    </div>
  );
};

export default App;
